import react from 'react'

const ProProjects = (props) => {
    // console.log(props.data[0].title)
    return (
        <react.Fragment>
            Hello!
            {props.data.map((project, idx) => {
                return (
                    <react.Fragment key={idx}>{project.title}</react.Fragment>
                )
            })}
        </react.Fragment>
    )
}

export default ProProjects;
